import Shell from "../Shell/Shell";
import TextField from "@mui/material/TextField";
import { Typography, Container } from "@mui/material";
import "./styles.css";
import { makeStyles } from "@mui/material/styles";
import { blue } from "@mui/material/colors";

const useStyles = makeStyles({
  nameContainer: {
    backgroundColor: blue,
  },
});

const contact = () => {
  const classes = useStyles();

  const properties = {
    nameContainer: {
      component: "div",
      classes: classes.nameContainer,
      id: "name",
    },
    email: {
      id: "email",
      type: "email",
      label: <Typography>Email</Typography>,
    },
    firstName: {
      id: "first name",
      type: "text",
      label: <Typography>first</Typography>,
    },
    lastName: {
      id: "last name",
      type: "text",
      label: <Typography>last</Typography>,
    },
  };

  return (
    <Shell
      heading="Contact Information"
      //   subheading="Click the button below to get started"
      content={
        <Container>
          <Container {...properties.nameContainer}>
            <TextField {...properties.firstName} />
            <TextField {...properties.lastName} />
          </Container>
          <TextField {...properties.email} />
        </Container>
      }
    />
  );
};

export default contact;
